import json
import os
from datetime import datetime
from enum import Enum
import logging
from typing import List, Dict, Optional

# Set up logging
logging.basicConfig(filename='submission_system.log', level=logging.INFO, 
                    format='%(asctime)s - %(levelname)s - %(message)s')

class PublishStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    ARCHIVED = "archived"

class FileType(Enum):
    PDF = "pdf"
    CSV = "csv"
    JSON = "json"
    XML = "xml"

class Submission:
    def __init__(self, user_id: str, file_path: str, file_type: FileType):
        self.user_id = user_id
        self.file_path = file_path
        self.file_type = file_type
        self.publish_status = PublishStatus.DRAFT
        self.upload_time = datetime.now()
        self.last_updated = self.upload_time
        self.validation_errors = []
        self.metadata = {
            "size": os.path.getsize(file_path),
            "created_at": self.upload_time.isoformat(),
            "updated_at": self.upload_time.isoformat()
        }

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.last_updated = datetime.now()
        self.metadata["updated_at"] = self.last_updated.isoformat()
        logging.info(f"Submission {self.file_path} status updated to {new_status.value}")

    def add_validation_error(self, error: str):
        self.validation_errors.append({"error": error, "timestamp": datetime.now().isoformat()})
        logging.warning(f"Validation error for submission {self.file_path}: {error}")

    def update_metadata(self, updates: Dict):
        self.metadata.update(updates)
        self.last_updated = datetime.now()
        self.metadata["updated_at"] = self.last_updated.isoformat()
        logging.info(f"Metadata updated for submission {self.file_path}")

class SubmissionSystem:
    def __init__(self):
        self.submissions = []
        self.published_files = {file_type.value: [] for file_type in FileType}

    def create_submission(self, user_id: str, file_path: str, file_type: FileType) -> Submission:
        if not os.path.exists(file_path):
            raise FileNotFoundError(f"File {file_path} does not exist")

        submission = Submission(user_id, file_path, file_type)
        self.submissions.append(submission)
        logging.info(f"New submission created: {file_path} by user {user_id}")
        return submission

    def validate_submission(self, submission: Submission) -> bool:
        try:
            if not submission.file_path.endswith(f".{submission.file_type.value}"):
                submission.add_validation_error(f"File extension does not match type {submission.file_type.value}")
                return False
            # Additional validation logic here (e.g., file content checks)
            return True
        except Exception as e:
            submission.add_validation_error(str(e))
            return False

    def publish_submission(self, submission: Submission):
        if self.validate_submission(submission):
            submission.update_publish_status(PublishStatus.PUBLISHED)
            self.published_files[submission.file_type.value].append(submission)
            logging.info(f"Submission {submission.file_path} published successfully")
        else:
            logging.error(f"Submission {submission.file_path} failed validation")

    def get_published_files(self, file_type: FileType) -> List[Submission]:
        return self.published_files.get(file_type.value, [])

    def delete_old_submissions(self, cutoff_date: datetime):
        for submission in self.submissions[:]:
            if submission.upload_time < cutoff_date and submission.publish_status != PublishStatus.PUBLISHED:
                self.submissions.remove(submission)
                logging.info(f"Deleted old submission: {submission.file_path}")

    def sync_fpds_data(self, fpds_data: Dict):
        # Simulate syncing with FPDS
        logging.info("Syncing FPDS data with system...")
        # Additional logic to process FPDS data

    def generate_test_report(self, user_id: str) -> Dict:
        user_submissions = [s for s in self.submissions if s.user_id == user_id]
        report = {
            "user_id": user_id,
            "submission_count": len(user_submissions),
            "validation_errors": sum(len(s.validation_errors) for s in user_submissions),
            "publish_statuses": {status.value: 0 for status in PublishStatus}
        }
        for submission in user_submissions:
            report["publish_statuses"][submission.publish_status.value] += 1
        logging.info(f"Generated test report for user {user_id}")
        return report

    def get_submission_errors(self, user_id: str) -> List[Dict]:
        errors = []
        for submission in self.submissions:
            if submission.user_id == user_id and submission.validation_errors:
                errors.append({
                    "file_path": submission.file_path,
                    "errors": submission.validation_errors
                })
        return errors

